INSERT INTO `questions` VALUES (1,'Critical Rendering Path란?','브라우저가 페이지의 초기 출력을 위해 실행해야 하는 순서를 Critical Rendering Path(CRP)라고 합니다.\n\n-DOM 트리 구축\n-CSSOM 트리 구축\n-JavaScript 실행\n-렌더 트리 구축\n-레이아웃 생성\n-페인팅',120,1,'2021-11-13 01:43:36','2021-11-13 01:43:36'),(2,'브라우저는 웹페이지를 어떻게 그리나요?','1 서버에서 응답으로 받은 HTML 데이터를 파싱한다.\n2 HTML을 파싱한 결과로 DOM Tree를 만든다.\n3 파싱하는 중 CSS 파일 링크를 만나면 CSS 파일을 요청해서 받아온다.\n4 CSS 파일을 읽어서 CSSOM(CSS Object Model)을 만든다.\n5 DOM Tree와 CSSOM이 모두 만들어지면 이 둘을 사용해 Render Tree를 만든다.\n6 Render Tree에 있는 각각의 노드들이 화면의 어디에 어떻게 위치할 지를 계산하는 ',120,1,'2021-11-13 01:43:36','2021-11-13 01:43:36'),(3,'브라우저는 어떻게 동작하나요?','렌더링 엔진은 통신으로부터 요청한 문서의 내용을 얻는 것으로 시작하는데 문서의 내용은 보통 8KB 단위로 전송된다.\n렌더링 엔진은 HTML 문서를 파싱하고 \"콘텐츠 트리\" 내부에서 태그를 DOM 노드로 변환한다. \n그 다음 외부 CSS 파일과 함께 포함된 스타일 요소도 파싱한다. \n스타일 정보와 HTML 표시 규칙은 \"렌더 트리\"라고 부르는 또 다른 트리를 생성한다.\n\n렌더 트리는 색상 또는 면적과 같은 시각적 속성이 있는 사각형을 포함하고 있는데 정해',120,1,'2021-11-13 01:43:36','2021-11-13 01:43:36'),(4,'Rest API란?','HTTP 프로토콜을 더 유연하게 사용하며 서버의 자원을 추가, 수정, 삭제, 업데이트 할 수 있도록 하는 것입니다.',120,2,'2021-11-15 10:56:16','2021-11-15 10:56:16'),(5,'대칭키와 비대칭키 차이','- 대칭키 암호화 방식(비밀키 암호화 방식)은 하나의 비밀키를 이용한 암호화 방식\n- 비대칭키 암호화 방식(공개키 암호화 방식)은 공개키와 개인키를 이용한 암호화 방식',120,2,'2021-11-15 10:56:16','2021-11-15 10:56:16'),(6,'패스워드 암호화 방법','- 단순 텍스트\n- 단방향 해시함수의 다이제스트\n- 솔팅\n- 키 스트레칭',120,2,'2021-11-15 10:56:16','2021-11-15 10:56:16'),(7,'오버라이딩과 오버로딩의 차이점과 특징','오버로딩은 \'많은 것을 싣는다\', 오버라이딩은 \'재정의한다\'는 사전적 의미를 가진 만큼 차이점도 이와 비슷하다고 볼 수 있습니다.\n오버로딩은 하나의 클래스 안에서 인스턴스 개수나 형식이 다른 동일한 이름의 메소드를 여러 개 정의하는 것이고 정적 바인딩입니다.\n오버라이딩은 상속을 했을 경우에 적용할 수 있고, 기존의 내용의 틀만 가져와서 재정의 하는 것이고 동적 바인딩입니다.',120,2,'2021-11-15 10:56:16','2021-11-15 10:56:16'),(8,'Ajax란?','Ajax는 자바스크립트 라이브러리 중 하나입니다. 브라우저가 가지고 있는 XMLhttpRequest객체를 이용해서 전체 페이지를 고치지 않고도 일부만을 위한 데이터를 로드하는 기법입니다. 한마디로 자바스크립트를 사용한 비동기 통신으로 클라이언트와 서버간에 XML데이터를 주고 받는 기술입니다.',120,3,'2021-11-15 11:01:48','2021-11-15 11:01:48'),(9,'동기식과 비동기식 차이','동기는 말 그대로 동시에 일어난다는 뜻입니다. 요청을 하면 시간이 얼마나 걸리던지 요청한 자리에 결과로 나와야합니다. 비동기식은 동시에 일어나지 않으며 요청과 동시에 결과가 일어나지 않을 거라는 약속입니다. 비동기식은 동기식보다 설계가 복잡하지만 결과가 주어지는 동안 다른 작업을 할 수 있다는 장점이 있습니다.',120,3,'2021-11-15 11:01:48','2021-11-15 11:01:48'),(10,'web server와 was차이','web server와 was차이\nweb server : HTTP 프로토콜을 기반으로 하여 웹브라우저의 요청을 서비스하는 기능을 담당합니다. 예를들어 \'apach server\', \'Nginx\'가 있습니다.\nwas : DB조회나 다양한 로직 처리를 요구하는 동적인 컨텐츠를 제공하기 위해 만들어진 어플리케이션 서버입니다. 예를들어 \'톰캣\', \'jeus\' 등이 있습니다.',120,3,'2021-11-15 11:01:48','2021-11-15 11:01:48'),(11,'CDN 이란?','대용량 또는 사용자의 잦은 요청이 있는 컨텐츠를 Cache 서버에 분산 배치하여 컨텐츠의 전송 중 발생하는 트래픽 집중과 병목현상 및 데이터 손실을 해결하기 위해 등장한 컨텐츠 전송기술입니다.\n작동원리\n - 웹 브라우저가 실행되는 PC나 모바일 기기의 사용자 에이전트가 특정 주소에 접근하여 HTML, 이미지, CSS, JS 파일 등 렌더링하는데 필요한 컨텐츠를 서버로부터 요청합니다.\n - DNS는 컨텐츠에 대한 각 요청이 발생하면 End User와 가장',120,3,'2021-11-15 11:01:48','2021-11-15 11:01:48'),(12,'JQurey 셀렉터','$( ) 모양을 사용합니다.\n - # : 아이다\n - . : 클래스\n - [] : 속성\n - > : 자식, 후손\n등 여러 셀렉터가 있습니다.',120,4,'2021-11-15 11:04:04','2021-11-15 11:04:04'),(13,'JQurey란? 특징은?','JQuery는 자바스크립트 라이브러리입니다. 자바스크립트를 좀 더 쉽게 사용하기 위해 만들어졌습니다. JQuery를 사용하면 짧고 단순한 코드로도 웹 페이지에 다양한 효과나 연출을 적용할 수 있습니다.\n\nJQuery는 구버전을 포함해 대부분의 웹에 지원되고, HTML DOM을 손쉽게 조작할 수 있으며 CSS스타일도 간단히 적용할 수 있습니다. 같은 동작을 하는 프로그램은 더욱 짧은 코드로 구현할 수 있습니다.',120,4,'2021-11-15 11:04:04','2021-11-15 11:04:04'),(14,'자바스크립트란? 스크립트언어란?','스크립트 언어란 소스코드를 컴파일 하지 않고도 실행할 수 있는 프로그래밍 언어입니다. C와 자바는 개발자가 작성한 코드를 컴파일러를 통해 기계어로 변경해야하지만 스크립트 언어는 컴파일 과정 없이 내장된 번역기에 의해 실행됩니다.\n\n자바스크립트를 한마디로 요약하자면 웹을 풍부하게 만들어주는 작고 가벼운 언어입니다. 웹 브라우저에서 실행하는 스크립트 언어를 기술하며 작고 빠르기 때문에 동적인 웹 문서를 꾸밀 때 널리 사용합니다. 객체 기반의 언어이지만, 상',120,4,'2021-11-15 11:04:04','2021-11-15 11:04:04'),(15,' 콜백 함수란?','무엇인가 일을 다른 객체에게 시키고 그 일이 끝나는 것을 기다리는 것이 아니라 그 객체가 나를 다시 부를 때까지 내 할 일을 하고 있는 것 입니다.',120,4,'2021-11-15 11:04:04','2021-11-15 11:04:04'),(16,' MVC는 무엇이고 1,2의 차이점은?','Model, View, Controller의 줄임말로써 MVC는 사용자와 상호작용하는 s/w를 디자인함에 있어 3가지 요소로 쪼개어 하는 것을 가르킵니다.\n\nModel은 프로그램 내부 상태 즉 프로그램 데이터를 말합니다. Controller는 데이터와 비즈니스 로직간의 상호작용입니다.\n\nMVC1은 웹브라우저의 요청을 jsp가 받아서 처리하는 구조입니다. jsp에 비즈니스 로직을 처리하기 위한 코드와 결과를 보여주기위한 출력관리가 뒤섞여있습니다. 단순한 ',120,5,'2021-11-15 11:15:31','2021-11-15 11:15:31'),(17,' RDBMS와 NOSQL 차이','NoSQL의 차별화된 특징은 RDBMS와 다르게 최초 테이블 생성 시 데이터간의 관계를 정의하지 않습니다. 그래서 보다 빠른 속도의 설계가 가능합니다. 또한 RDBMS가 가지고 있던 복잡도와 용량의 한계를 극복하며 페타바이트 이상 급의 데이터를 저장합니다. NoSQL은 Scale out을 통한 노드 확장을 지원합니다. 하나의 고성능 머신이 데이터 서버가 되어 처리하는 scale up방식의 RDBMS와 달리 여러개의 일반 서버를 연결하여 데이터를 분산하고',120,5,'2021-11-15 11:15:31','2021-11-15 11:15:31'),(18,'URI, URL, URN이란?','URI에는 URN과 URN이 포함되어 있습니다. URL은 URI지만 URI는 URL이 아닙니다.\nURI : 인터넷 상의 자원을 식별하기 위한 문자열 구성\nURL : 인터넷 상의 자원의 위치를 나타냄\nURN : 위치와 상관없이 리소스의 이름값을 이용해 접근하는 방식',120,5,'2021-11-15 11:15:31','2021-11-15 11:15:31'),(19,'GET과 POST의 차이점에 대해서 설명해보세요.','대개의 경우 아래의 HTTP 메서드 질문을 더 많이합니다. 하지만 둘의 차이만을 물을 수도 있습니다.\n\nGET요청은 서버에 존재하는 정보를 요청합니다. 이 때 반환되는 정보는 정보 자체가 아니라 정보의 표현입니다.(뒤의 내용은 REST와 연관이 있고, 굳이 답변하지 않으셔도 됩니다.) 일반적으로 Request Body는 입력하지 않는 것이 일반적이며, 레거시 시스템의 경우 요청을 받아들이지 않을 수 있습니다. 캐싱을 수행하기 때문에 캐싱되지 않는 요청은',120,6,'2021-11-15 12:51:20','2021-11-15 12:51:20'),(20,'HTTP와 HTTPS의 차이점에 대해서 설명해보세요.','HTTP는 따로 암호화 과정을 거치지 않기 때문에 중간에 패킷을 가로챌 수 있고, 수정할 수 있습니다. 따라서 보안이 취약해짐을 알 수 있습니다. 이를 보완하기 위해 나온 것이 HTTPS입니다. 중간에 암호화 계층을 거쳐서 패킷을 암호화합니다.',120,6,'2021-11-15 12:51:20','2021-11-15 12:51:20'),(21,'TCP와 UDP의 차이점에 대해서 설명해보세요.','TCP는 연결 지향형 프로토콜이고 UDP는 데이터를 데이터그램단위로 전송하는 프로토콜입니다.\n\nTCP는 가상 회선을 만들어 신뢰성을 보장하도록(흐름 제어, 혼잡 제어, 오류 제어) 하는 프로토콜로 따로 신뢰성을 보장하기 위한 절차가 없는 UDP에 비해 속도가 느린편입니다.\n\nTCP는 그래서 파일전송과 같은 신뢰성이 중요한 서비스에 사용되고, UDP는 스트리밍, RTP와 같이 연속성이 더 중요한 서비스에 사용됩니다.\n\n+) 하지만 UDP도 신뢰성을 UDP',120,6,'2021-11-15 12:51:20','2021-11-15 12:51:20'),(22,'트랜잭션 격리 수준(Transaction Isolation Levels)에 대해서 설명해주세요.','트랜잭션 격리수준은 고립도와 성능의 트레이드 오프를 조절합니다.\n\nREAD UNCOMMITTED: 다른 트랜잭션에서 커밋되지 않은 내용도 참조할 수 있다.\nREAD COMMITTED: 다른 트랜잭션에서 커밋된 내용만 참조할 수 있다.\nREPEATABLE READ: 트랜잭션에 진입하기 이전에 커밋된 내용만 참조할 수 있다.\nSERIALIZABLE: 트랜잭션에 진입하면 락을 걸어 다른 트랜잭션이 접근하지 못하게 한다.(성능 매우 떨어짐)',120,7,'2021-11-15 12:53:02','2021-11-15 12:53:02'),(23,'트랜잭션에 대해서 설명해주세요.','트랜잭션이란 데이터베이스의 상태를 변화시키는 하나의 논리적인 작업 단위라고 할 수 있으며, 트랜잭션에는 여러개의 연산이 수행될 수 있습니다.\n\n트랜잭션은 수행중에 한 작업이라도 실패하면 전부 실패하고, 모두 성공해야 성공이라고 할 수 있습니다.',120,7,'2021-11-15 12:53:02','2021-11-15 12:53:02'),(24,'데이터베이스에서 인덱스를 사용하는 이유 및 장단점에 대해 설명해주세요.','데이터베이스에서 인덱스를 사용하는 이유는 검색성능을 향상시키기 위함입니다.\n\n하지만 검색성능을 실질적으로 향상시키기 위해서는 해당 쿼리가 index를 사용하는지, 카디널리티, Selectivity 같은 요소들이 고려된 인덱스가 생성되어야 합니다.\n\n일반적인 경우의 장점으로는 빠른 검색 성능을 들 수 있습니다.\n\n일반적인 경우의 단점으로는 인덱스를 구성하는 비용 즉, 추가, 수정, 삭제 연산시에 인덱스를 형성하기 위한 추가적인 연산이 수행됩니다.\n\n따라서',120,7,'2021-11-15 12:53:02','2021-11-15 12:53:02'),(25,'기술을 습득할 때 어떤 식으로 습득하나요?','CASE by CASE',120,8,'2021-11-15 13:03:25','2021-11-15 13:03:25'),(26,'본인이 수행한 프로젝트 중 상용화 가능한 프로젝트가 있나요?','CASE by CASE',120,8,'2021-11-15 13:03:25','2021-11-15 13:03:25'),(27,'최적화 과정 설명해보세요','스크립트 준비 중..',120,9,'2021-11-16 01:34:12','2021-11-16 01:34:12'),(28,'브라우저는 웹 페이지를 어떻게 그리나요?','스크립트 준비 중..',120,9,'2021-11-16 01:34:12','2021-11-16 01:34:12'),(29,'브라우저의 기본 구조를 설명해보세요.','스크립트 준비 중...',120,9,'2021-11-16 01:34:12','2021-11-16 01:34:12'),(30,'CORS를 해결하는 방법을 설명해보세요.','스크립트 준비 중...',120,10,'2021-11-16 01:40:02','2021-11-16 01:40:02'),(31,'CORS에 관련된 정책들을 설명해보세요','스크립트 준비 중...',120,10,'2021-11-16 01:40:02','2021-11-16 01:40:02'),(32,'무엇이 출력 될까요?','```js\nconst obj = { 1: \'a\', 2: \'b\', 3: \'c\' };\nconst set = new Set([1, 2, 3, 4, 5]);\n\nobj.hasOwnProperty(\'1\');\nobj.hasOwnProperty(1);\nset.has(\'1\');\nset.has(1);\n\n```',120,11,'2021-11-16 01:48:49','2021-11-16 01:48:49'),(33,'무엇이 출력 될까요?','```js\nconst a = {};\nconst b = { key: \'b\' };\nconst c = { key: \'c\' };\n\na[b] = 123;\na[c] = 456;\n\nconsole.log(a[b]);\n```',120,11,'2021-11-16 01:48:49','2021-11-16 01:48:49'),(34,'CSS는 어떻게 작동하나요?','CSS는',120,12,'2021-11-16 04:22:48','2021-11-16 04:22:48'),(35,'SPA란 무엇인가요?','SPA란...',120,12,'2021-11-16 04:22:48','2021-11-16 04:22:48'),(36,'let, var, const의 차이점과 호이스팅 (Hoisting)에 대해 설명해주세요.','3. 변수 호이스팅\n(1) let\n\nlet 키워드로 선언한 변수는 선언 단계와 초기화 단계가 분리되어 진행된다. 즉, 런타임 이전에 자바스크립트 엔진에 의해 선언 단계가 먼저 실행되지만, 초기화 단계가 실행되지 않았을 때 해당 변수에 접근하려고 하면 참조 에러가 뜬다.\n\n따라서 let 키워드로 선언한 변수는 스코프의 시작 지점부터 초기화 단계 시작 지점까지 변수를 참조할 수 없는 일시적 사각지대(Temporal Dead Zone: TDZ) 구간에 존재한',600,13,'2021-11-16 11:29:03','2021-11-16 11:29:03'),(37,'let, var, const의 차이점과 호이스팅 (Hoisting)에 대해 설명해주세요.','var 키워드의 문제점은 크게 세 가지가 존재한다.\n\n변수 중복 선언 가능하여, 예기치 못한 값을 반환할 수 있다.\n함수 레벨 스코프로 인해 함수 외부에서 선언한 변수는 모두 전역 변수로 된다.\n변수 선언문 이전에 변수를 참조하면 언제나 undefined를 반환한다.\n\nlet과 const 키워드는 위의 세 가지 문제점을 해결했다.\n\n(1) let\n\nlet 키워드로는 변수 중복 선언이 불가하지만, 재할당은 가능하다.\n\n(2) const\n\nconst가 le',600,13,'2021-11-16 11:29:03','2021-11-16 11:29:03'),(38,'Javascript와 Nodejs가 어떻게 다른 것인지 설명해주세요.','Node.js의 장점\n1. 비동기 처리로 인해 매우 빠른 고성능 서버 구현\n\n2. 한 가지 언어만으로도 서버-클라이언트 모두 개발\n\n3. 구글의 최신화된 VB Engine을 이용\n\n4. 적은 양의 자원으로 일을 처리\n\n5. 높은 커뮤니티 이용율 및 참여율',600,14,'2021-11-16 11:31:31','2021-11-16 11:31:31'),(39,'Javascript와 Nodejs가 어떻게 다른 것인지 설명해주세요.','Node/js는 터미널 프로그램(원도우 cmd, mac terminal 등)에서 node를 입력하여 브라우저 없이도 실행할 수 있게 됐다.\n\n\nJavaScript를 크롬(Chrome)같은 브라우저에서만 쓰는 것이 아닌 브라우저 밖. 즉, 내 컴퓨터에서 다양한 용도로 확장하기 위해 만들어진 것이 바로 Node.js이다. Node.js를 이용하면 Python과 같이 내 컴퓨터에서 File System를 이용할 수 있고, 서버를 만들 수도 있고 크롤링도 할 ',600,14,'2021-11-16 11:31:31','2021-11-16 11:31:31'),(40,'모든 자바스크립트 파일을 브라우저에서 한 번에 로딩 할 때의 문제점을 설명해주세요.','자바스크립트 파일은 해당 파일을 가져올 때까지 HTML 문서의 구문 분석을 중단한다.\n\n스크립트를 가져와서 실행하기 위해 HTML 구문 분석이 일시 중지되므로 HTML이 화면에 출력되는 시간이 길어진다. 만약 모든 자바스크립트 파일을 브라우저에서 한 번에 로딩하게 된다면 그만큼 HTML이 화면에 출력되는 것이 늦어지므로 스크립트 파일이 다 로드 될 때까지 아무것도 볼 수 없는 유저의 입장에서는 해당 페이지에 오류가 있다고 판단하여 페이지를 이탈할 가능성',300,15,'2021-11-16 11:34:21','2021-11-16 11:34:21'),(41,'자바스크립트 async와 await에 대해 설명하세요','async & await는 뭔가요?\nasync와 await는 자바스크립트의 비동기 처리 패턴 중 가장 최근에 나온 문법입니다. 기존의 비동기 처리 방식인 콜백 함수와 프로미스의 단점을 보완하고 개발자가 읽기 좋은 코드를 작성할 수 있게 도와주죠.\nasync & await 기본 문법\n먼저 함수의 앞에 async 라는 예약어를 붙입니다. 그러고 나서 함수의 내부 로직 중 HTTP 통신을 하는 비동기 처리 코드 앞에 await를 붙입니다. 여기서 주의하셔야 ',600,16,'2021-11-20 10:26:57','2021-11-20 10:26:57'),(42,'자바스크립트 Promise 쉽게 이해하기','Promise가 뭔가요?\n프로미스는 자바스크립트 비동기 처리에 사용되는 객체입니다. 여기서 자바스크립트의 비동기 처리란 ‘특정 코드의 실행이 완료될 때까지 기다리지 않고 다음 코드를 먼저 수행하는 자바스크립트의 특성’을 의미합니다. \nPromise가 왜 필요한가요?\n프로미스는 주로 서버에서 받아온 데이터를 화면에 표시할 때 사용합니다. 일반적으로 웹 애플리케이션을 구현할 때 서버에서 데이터를 요청하고 받아오기 위해 아래와 같은 API를 사용합니다.\n프로',600,16,'2021-11-20 10:26:57','2021-11-20 10:26:57'),(43,'자바스크립트 비동기 처리와 콜백 함수 설명해주세요','비동기 처리? 그게 뭔가요?\n자바스크립트의 비동기 처리란 특정 코드의 연산이 끝날 때까지 코드의 실행을 멈추지 않고 다음 코드를 먼저 실행하는 자바스크립트의 특성을 의미합니다.\n\n비동기 처리의 첫 번째 사례\n비동기 처리의 가장 흔한 사례는 제이쿼리의 ajax입니다. 제이쿼리로 실제 웹 서비스를 개발할 때 ajax 통신을 빼놓을 수가 없습니다. 보통 화면에 표시할 이미지나 데이터를 서버에서 불러와 표시해야 하는데 이때 ajax 통신으로 해당 데이터를 서버',600,16,'2021-11-20 10:26:57','2021-11-20 10:26:57');
